import React from "react";

export default function Categories() {
  return (
    <div className="categories">
      <ul>
        <li className="active">Всі</li>
        <li>М'ясні</li>
        <li>Вегетаріанські</li>
        <li>Гриль</li>
        <li>Гострі</li>
        <li>Сирні</li>
      </ul>
    </div>
  );
}
